      <div>
        <ListItem>
          <img className = 'pic' src='https://img.3dmgame.com/uploads/images/news/20201219/1608366988_358099.jpg' />
          <ListInfo>
            <h3 className='title'>投资者对《2077》不满 律师事务所对CDPR提起集体诉讼</h3>
            <p className='desc'>之前CDPR宣布《赛博朋克2077》全球销量已超过1300万份，使其成为有史以来最成功的RPG游戏之一。但现在一盆冷水泼在CDPR头上了...</p>
          </ListInfo>
        </ListItem>

        <ListItem>
          <img className = 'pic' src='https://img.3dmgame.com/uploads/images/news/20201219/1608366988_358099.jpg' />
          <ListInfo>
            <h3 className='title'>投资者对《2077》不满 律师事务所对CDPR提起集体诉讼</h3>
            <p className='desc'>之前CDPR宣布《赛博朋克2077》全球销量已超过1300万份，使其成为有史以来最成功的RPG游戏之一。但现在一盆冷水泼在CDPR头上了...</p>
          </ListInfo>
        </ListItem>
      </div>
    )
  }

}

export default List;
